if(_parent.技能浮空 == true)
{
   if(_parent.Z轴坐标 - _parent._y >= 30)
   {
      this.onEnterFrame = function()
      {
         if(_parent.Z轴坐标 - _parent._y >= 30)
         {
            _parent.垂直速度 += 20;
            _parent._y += _parent.垂直速度;
            if(_parent._y > _parent.Z轴坐标)
            {
               _parent._y = _parent.Z轴坐标;
            }
            stop();
         }
         else
         {
			_parent._y = _parent.Z轴坐标;
            if(_parent.flySpeed > 0)
            {
               _parent.flySpeed = 0;
            }
			落地 = true;
			_parent.浮空 = false;
			_parent.技能浮空 = false;
            play();
            delete this.onEnterFrame;
         }
      };
   }
}

觉醒地震子弹威力 = 10 * _parent.内力 + _parent.空手攻击力 * 0.2 + 7 * _parent.内力 * (1 + _parent.技能等级 * 0.7);
if (_parent.hp攻击加成)
{
	觉醒地震子弹威力 += _parent.hp攻击加成;
}
if (_parent.mp攻击加成)
{
	觉醒地震子弹威力 += _parent.mp攻击加成;
}
震血攻击 = _root.技能函数.震血攻击;

onClipEvent (load) {
	声音 = "";
	霰弹值 = 1;
	子弹散射度 = 0;
	发射效果 = "";
	子弹种类 = "魔法特效1";
	子弹威力 = _parent.觉醒地震子弹威力;
	子弹速度 = 0;
	击中地图效果 = "";
	Z轴攻击范围 = 35;
	击倒率 = 1;
	击中后子弹的效果 = "";
	if (_parent._parent.是否为敌人 == true)
	{
		子弹敌我属性 = false;
	}
	else
	{
		子弹敌我属性 = true;
	}
	var myPoint = {x:this._x, y:this._y};
	_parent.localToGlobal(myPoint);
	_root.gameworld.globalToLocal(myPoint);
	shootX = myPoint.x;
	shootY = myPoint.y;
	_root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
}

